import React, { Component } from 'react';
import * as eng from '../../providers/engine';

import AcademyHome from './home';
import AcademyIntro from './intro';

export default class Academy extends Component {

    render() {
        const route = eng.getStorageJson('route');
        const type = route.type?route.type:'';
        switch(type){
            case 'intro':
                return <AcademyIntro />;
            default:
                return <AcademyHome />;
        }
    }

}
